import './App.css';
import colors from './Data/ColorData';

function App() {
  return (
    <div>
      <h1> Color List</h1>
      <hr />
      <ul>
        {colors.map((element => {
          return (
            <li key={element.hex}>
              <div style={{ backgroundcolor: colors.hex }}className="color-display"></div>
              {element.name}</li>
          )
        }))}
      </ul>
    </div>
  );
}

export default App;
